import React from 'react';


const Navbar = () => {
    return(
    <>
    <nav>
    <img src="images/finallogo.png" alt= "Drip logo" className="elogo"/>
    <ul>
        <li>
            <NavLink exact ={true} className = "nav-link" to="/"></NavLink>

            </li>
        <li><a href= "drip.html">Drip</a></li>
        <li>
            <NavLink exact ={true} className = "nav-link" to="/contact">Contact</NavLink>

            </li>
    </ul>
    </nav>
</>
    )
}

export default Navbar;
